import 'react-native-gesture-handler';
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import GalleryScreen from './GalleryScreen'; // Importa tu componente de la Galería
import AddImageScreen from './AddImageScreen'; // Importa tu componente para agregar imágenes

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Gallery" component={GalleryScreen} />
        <Stack.Screen name="AddImage" component={AddImageScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
